import InputPrice from "./InputPrice";


export default function Filter({ minPrice, maxPrice, onMinPriceChange, onMaxPriceChange, filterHandler }) {
    return (
        <div className="col-md-3 px-5">
            <h4>Filter</h4>
            <hr/>
            <form className="form">
                <InputPrice label={"Prix minimum"} value={minPrice} onChanging = {onMinPriceChange}/>
                <InputPrice label={"Prix maximum"} value={maxPrice} onChanging = {onMaxPriceChange}/>
            </form>
            <button className="mt-3 btn btn-info px-5" onClick={filterHandler}>Filtrer</button>
        </div>
    );
}
